import { useNavigate } from 'react-router-dom';
import logoBookMyShow from "../../Assets/Bookmyshow-logoid.png"
import './Navbar.css';
import {Link} from "react-router-dom";

function Navbar(){
    const navigate = useNavigate();
    return <div className='Navbar'>
        <Link to="/">
            <img className="MainLogo" src={logoBookMyShow} alt={logoBookMyShow}></img>
        </Link>
        <input className='NavSearch' type='text' placeholder='Search for Movies'/>
        <button className='LoginButton' onClick={() => navigate("/Login")}>Log In</button>
        <button className='RegisterButton' onClick={() => navigate("/RegisterUser")}>Register</button>
    </div>
}

export default Navbar;
